import React from "react";
import EventsList from "../components/EventsList";
import { useLoaderData } from "react-router-dom";

const Events = () => {
  const eventData = useLoaderData();

  return (
    <React.Fragment>
      <div style={{ textAlign: "center" }}>
        <EventsList events={eventData} />
      </div>
    </React.Fragment>
  );
};

export default Events;

export const loader = async () => {
  const response = await fetch("http://localhost:8080/eventssks");
  if (!response.ok) {
    throw new Response(
      JSON.stringify({ message: "unable to fetch events" }, { staus: 500 })
    );
  }
  return response;
  // const fetchedEvent = await response.json();
  // return fetchedEvent.events;
};
